let char_to_prop c =
  match c with
  (*trees*)
  | "t " ->  ("tree.png", Vector.{x = 206. ; y = 192.}, None )
  | "t1" ->  ("tree2.png", Vector.{x = 289. ; y = 256.}, None )
  | "t2" ->  ("tree3.png", Vector.{x = 164. ; y = 260.}, None )
  (*houses*)
  | "th" ->  ("tree-house.png", Vector.{x = 224. ; y = 256.}, None )
  | "h " ->  ("wooden-house.png", Vector.{x = 212. ; y = 192.}, None )
  (*Rocks*)
  | "r " ->  ("rock.png", Vector.{x = 64. ; y = 32.}, None )
  | "r1" ->  ("rock1.png", Vector.{x = 106. ; y = 106.}, None )
  | "r2" ->  ("rock2.png", Vector.{x = 132. ; y = 114.}, None )
  (*foliage*)
  | "u " ->  ("bush.png", Vector.{x = 64. ; y = 32.}, None )
  | "m " ->  ("shrooms.png", Vector.{x = 32. ; y =32.}, None )
  (*misc*)
  | "l " ->  ("sign.png", Vector.{x = 32. ; y = 40.}, None )
  | "sk" ->  ("skulls.png", Vector.{x = 32. ; y = 32.}, None )

  (*crates*)
  | "c " ->  ("crate.png", Vector.{x = 32. ; y = 32.}, None )
  | "c1" ->  ("crate2.png", Vector.{x = 64. ; y = 64.}, None )
  (*blocks*)
  | "b " ->  ("block.png", Vector.{x = 32. ; y = 32.}, None )
  | "b1" ->  ("block2.png", Vector.{x = 64. ; y = 64.}, None )
  | "b2" ->  ("block3.png", Vector.{x = 64. ; y = 64.}, None )

  (*TILESET*)
  | tile ->
      let tileset = "tileset.png" in
      let box = ref Vector.{x = 32.; y= 32.} in
      let pos = ref Vector.zero in

      begin
      match tile with
        (*Cave entry bg*)
        (*TODO: add mirrored side*)
        | "g1" ->  pos :=  Vector.{x = 1. ; y = 15.}
        | "g2" ->  pos :=  Vector.{x = 2. ; y = 15.} 
        | "g3" ->  pos :=  Vector.{x = 2. ; y = 16.} 
        | "g4" ->  pos :=  Vector.{x = 2. ; y = 17.}
        | "g5" ->  pos :=  Vector.{x = 1. ; y = 17.} 

        (*Cave bgs*)
        | "f1" ->  pos :=  Vector.{x = 17. ; y = 16.} 
        | "f2" ->  pos :=  Vector.{x = 18. ; y = 16.} 
        | "f3" ->  pos :=  Vector.{x = 19. ; y = 16.} 

        | "f4" ->  pos :=  Vector.{x = 17. ; y = 18.} 
        | "f5" ->  pos :=  Vector.{x = 17. ; y = 18.} 
        | "f6" ->  pos :=  Vector.{x = 17. ; y = 20.} 

        (*Cave ceilings plants*)
        | "p1" -> box :=  Vector.{x = 32. ; y = 64.}; pos :=  Vector.{x = 7. ; y = 13.} 
        | "p2" -> box :=  Vector.{x = 32. ; y = 96.}; pos :=  Vector.{x = 9. ; y = 13.} 
        | "p3" -> box :=  Vector.{x = 32. ; y = 64.}; pos :=  Vector.{x = 11. ; y = 13.} 
        | "p4" -> box :=  Vector.{x = 0. ; y = 0.}; pos :=  Vector.{x = 13. ; y = 13.} 
        | _ -> failwith "undone"
      end;

      (tileset,!box,Some (Vector.mult 32. !pos))
 

  (*TODO ajouter un attribut flip pour flip les textures au hasard a l'init*)
let char_to_tag c = 
  match c with 
  | "OP" -> Component_defs.Opossum
  | "EA" -> Component_defs.Eagle
  | "SL" -> Component_defs.Slime
  | "GH" -> Component_defs.Ghost
  | _ -> Ghost
  
let char_to_vect c =
  let pos = 
    match c with
    (*TODO: AJouter au hasard de l'herbe sur des blocs*)
    (*Grass*)
    (*Upper*) 
    |"1 " -> Vector.{x = 1. ; y = 1. }
    |"2 " -> Vector.{x = 3. ; y = 1. }
    |"3 " -> Vector.{x = 5. ; y = 1. }

    (*Middle*)
    |"4 " -> Vector.{x = 1. ; y = 3. }
    |"6 " -> Vector.{x = 5. ; y = 3. }

    (*Bottom*)
    |"7 " -> Vector.{x = 1. ; y = 5. }
    |"8 " -> Vector.{x = 3. ; y = 5. }
    |"9 " -> Vector.{x = 5. ; y = 5. }

    (*Bricks*)
    (*Upper*) 
    |"11" -> Vector.{x = 15. ; y = 7. }
    |"12" -> Vector.{x = 17. ; y = 7. }
    |"13" -> Vector.{x = 19. ; y = 7. }

    (*Middle*)
    |"14" -> Vector.{x = 15. ; y = 9. }
    |"16" -> Vector.{x = 19. ; y = 9. }

    (*bottom*)
    |"17" -> Vector.{x = 15. ; y = 11. }
    |"18" -> Vector.{x = 17. ; y = 11. }
    |"19" -> Vector.{x = 19. ; y = 11. }

    (*Underground*)
    | "00" -> 
        let vectors = [{Vector.x = 3.; y = 3.}; 
                       {Vector.x = 3.; y = 3.};
                       {Vector.x = 7.; y = 7.}; 
                       {Vector.x = 5.; y = 7.}] in

        List.nth vectors (Random.int 4)

    (*Spikes*)
    | "21" -> Vector.{x = 1. ; y = 13.}
    | "22" -> Vector.{x = 3. ; y = 13.}
    | "23" -> Vector.{x = 5. ; y = 13.}

    (*Transparent*)
    |"0" -> Vector.{x = 0. ; y = 0. }

    (*Grass up*)
    |"10" -> Vector.{x = 5. ; y = 5. }

    (*TODO add solid blocks and those who can be passed through below*)
    | _ -> Vector.{x = 0.; y = 1.}
  in 

  Vector.{x = pos.x *. float_of_int w_width  ; y = pos.y *. float_of_int w_height }




